import { result } from "lodash";
import React from "react";
import GameInfo from "../../../components/Games/GameInfo";

const Results = ({ results }) => {
  console.log({ results });
  const gameInfo = {
    homeTeam: {
      name: results.home.team_name,
      logo: results.home.logo.url,
      score: results.home_score,
    },
    homeTeam: {
      name: results.away.team_name,
      logo: results.away.logo.url,
      score: results.away_score,
    },
  };
  return <GameInfo></GameInfo>;
};

export default Results;
